					"content": "<p>When I was 13 my only purpose was to become the star on our football team. That meant&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;Miller King, who was the best&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;at our school.</p>\n<p>Football season started in September and all summer long I worked out. I carried my football everywhere for&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;.</p>\n<p>Just before September, Miller was struck by a car and lost his right arm. I went to see him after he came back from&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;. He looked very&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;, but he didn&#39;t cry.</p>\n<p>That season, I&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;all of Miller&#39;s records while he&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;the home games from the bench. We went 10-1 and I was named most valuable player,&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;8&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;I often had crazy dreams in which I was to blame for Miller&#39;s&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;.</p>\n<p>One afternoon, I was crossing the field to go home and saw Miller&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;10&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;going over a fence&mdash;which wasn&#39;t&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;11&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;to climb if you had both arms. I&#39;m sure I was the last person in the world he wanted to accept&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;from. But even that challenge he accepted. I&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;13&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;him move slowly over the fence. When we were finally&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;14&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;on the other side, he said to me, &quot;You know, I didn&#39;t tell you this during the season, but you did&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;15&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;. Thank you for filling in for&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;16&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;.&quot;</p>\n<p>His words freed me from my bad&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;17&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;. I thought to myself, how even without an arm he was more of a leader. Damaged but not defeated, he was&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;18&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;ahead of me. I was right to have&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;19&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;him. From that day on, I grew&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;20&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;and a little more real.&nbsp;<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;21&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</u>&nbsp;</p>",
